fn gen_array(rng: &mut Rng) -> [i8; 1024] {
    let mut buffer: [u8; 1024] = [0; 1024];

    for i in 0..(1024/8) {
        let rn: u64 = rng.next_u64();

        buffer[(i * 8)..((i + 1) * 8)].copy_from_slice(&u64::to_le_bytes(rn));
    }

    let arr: [i8; 1024] = bytemuck::cast(buffer);

    return arr;
}

fn random_expanded_key(mut exp_key: &mut [fpr], rng: &mut Rng) {
    const LOGN: usize = 8;
    const exp_tmp_len: usize = falcon_tmpsize_expandprivate!(LOGN) / 8;

    let mut exp_tmp = [0; exp_tmp_len];
    let mut f: [i8; 1024] = gen_array(rng);
    let mut g: [i8; 1024] = gen_array(rng);
    let mut F: [i8; 1024] = gen_array(rng);
    let mut G: [i8; 1024] = gen_array(rng);

    expand_privkey(&mut exp_key, &f, &g, &F, &G, LOGN as u32, &mut exp_tmp);
}


fn mask_expanded_key<const ORDER: usize, const EXKLENGTH: usize>(key: &[fpr], rng: &mut Rng) -> [[fpr; ORDER]; EXKLENGTH] {
    //const LOGN: usize = 8;
    //const exp_key_len: usize = falcon_tmpsize_expanded_key_size!(LOGN);
    //let (_, random_key3) = random_key2.split_at_mut(8); // alignment

    let mut random_key: [fpr; EXKLENGTH] = [0; EXKLENGTH];
    random_expanded_key(&mut random_key, rng);

    let mut mkey: [[fpr; ORDER]; EXKLENGTH] = [[0; ORDER]; EXKLENGTH];
    for i in 0..key.len() {
        let mut mask: [fpr; ORDER] = [0; ORDER];
        let random_fpr = random_key[i];
        mask[0] = fpr_sub(key[i], random_fpr);
        mask[1] = random_fpr;
        mkey[i] = mask;
    }
    mkey
}

