fn gen_rng(input: &[u8]) -> InnerShake256Context {
    let state: [u64; 25] = [0; 25];
    let dptr: u64 = 0;
    let mut sc_rust = InnerShake256Context { st: state, dptr};
    i_shake256_init(&mut sc_rust);
    i_shake256_inject(&mut sc_rust, &input);
    return sc_rust;
}

